// DogRunPage.tsx
import React,{useState} from "react";
import {Link} from "react-router-dom" //linkをインポート
import "./DogRunPage.css";

const DogRunPage: React.FC = () => {
  const [isDropdownVisible, setIsDropdownVisible] = useState(false)

   // ドロップダウンの表示/非表示を切り替える関数
   const toggleDropdown = () => {
    setIsDropdownVisible(!isDropdownVisible);
   };

  return (
    <>
    <div className="dogrun-page">
    <header className="header">wan paradise</header>
    <div className="tab-container" onClick={toggleDropdown}>
      <span>全国のドッグランを探す</span>
    </div>
    {/* ドロップダウンメニューの表示 */}
    {isDropdownVisible && (
    <div className="dropdown-menu">
      <ul>
        <li><Link to="/hokkaido">北海道</Link></li>
        <li>東北</li>
        <li>関東</li>
        <li>中部</li>
        <li>関西</li>
        <li>中国</li>
        <li>四国</li>
        <li>九州</li>
        <li>沖縄</li>
      </ul>
    </div>
    )}

      <div className="dogrun-img">
        <img
          src={dogrun}
          alt="ドッグランのイラスト"
          className="dogrun-illust"
        />
      </div>
      </div>
    </>
  );
};

export default DogRunPage;
